import React from 'react';

class BadgesList extends React.Component {
  render() {
    return(
      this.props.badgesListValues.map((badge) => {
        return (
          <div className='BadgesList__Badge-container row'>
            <div className='BadgeList__BadgeAvatar-container col-2'>
              <img className='BadgeList__BadgeAvatar' src='https://www.gravatar.com/avatar/f63a9c45aca0e7e7de0782a6b1dff40b?d=identicon' alt='BadgeAvatar' />
            </div>
            <div className='BadgeList__BadgeInfo-container col-10' >
              <span>{badge.firstName} {badge.lastName}</span>
              <div>@{badge.twitter}</div>
              <p>JobTitle</p>
            </div>
          </div>
        );
      })
    );
  };
}

export default BadgesList;
